        raise CustomError("Cannot divide by zero")
    return a / b

def safe_conversion(value):
    try:
        result = int(value)
        return result
    except ValueError:
        print(f"Cannot convert '{value}' to integer")
        return None
    except Exception as e:
        print(f"Unexpected error: {e}")
        return None
    finally:
        print("Conversion attempt completed")

